import React from "react";
import "./header.css";
export interface HeaderProps {}

export interface HeaderState {}

export function Header() {
  return (
    <header>
      <div className="row">
        <div className="logo">
          <img
            src="https://www.moonactive.com/wp-content/uploads/2019/09/Gray_logo2.svg"
            alt="moonActive"
          />
        </div>
        <div className="author">Batya Mendelson</div>
      </div>
    </header>
  );
}
export default Header;
